            'safe_value' => "<h1>Overview</h1>\n\n<p>This page provides a short tutorial for the online analysis interface for INTEGRAL/ISGRI data. We strongly encourage you to register and login<br />\nMore details can be found on the <a href=\"https://arxiv.org/abs/2002.12895\" target=\"_blank\">AstrODA paper</a>. This is a web interface runs the OSA INTEGRAL analysis on servers of the University of Geneva.<br />\nDetails on INTEGRAL analysis can be found at the <a href=\"https://www.isdc.unige.ch/integral/analysis\" target=\"_blank\">ISDC pages</a>.<br />\n<strong>In each session, the analysis is limited to 50 science windows for unregistered users and 500 for registered user.</strong></p>\n\n<p><strong>A registered user will receive an email with the request link to check the status an API code to make the same request through python and a notification at job completion.<br />\nIn general, if you send again a request after some hours: the results will appear in a few seconds. But only if the request is exactly the same (the best way is by clicking on the submission email).</strong></p>\n\n<h2>Source query panel</h2>\n\n<p>Top panel of the interface defines parameters of analysis not specific to ISGRI. You can select a source and a time interval. The tool will select for you<br />\nat most 50 science windows within your time interval.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/topoda1.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/topoda1.png?itok=Qwkoxiq4\" style=\"height:210px; width:480px\" /> </a></p>\n\n<p>This panel could be used for multi-instrument analysis.</p>\n\n<h2>Instrument query panel</h2>\n\n<p>ISGRI specific parameters appear when  \"INTEGRAL ISGRI\" button is selected in the virtual desktop field.</p>\n\n<p>Here you can select the search radius OR an explicit list of science windows in the format 236100030010.001,<br />\n236100040010.001 or uploading a text file with one science window per line (it can be downloaded from <a href=\"https://www.isdc.unige.ch/integral/archive#Browse\" target=\"_blank\">W3Browse</a>).<br />\nIf you select a time range, you can limit the maximum number of science windows to be randomly picked to 50 (for not logged user) or 500 (if you log in).</p>\n\n<p>If you log in and you are assigned a role, you can access also private data after agreeing on the conditions of use.</p>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/isgri-query.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/isgri-query.png?itok=9D90dws8\" style=\"height:480px; width:256px\" /> </a></p>\n\n<p>A box with parameters for imaging, spectral and timing analysis appears in this case.</p>\n\n<h1>A full analysis thread</h1>\n\n<p>A generic analysis flow typically starts from Imaging analysis and proceeds through Imaging -&gt; Spectral and/or timing analysis chains. Spectral and timing analysis steps rely on results of the imaging analysis (on catalog of sources found in imaging analysis) and it is recommended to always start from the imaging analysis step. The analysis steps are described below (we will repeat what you have already seen):</p>\n\n<h2>QUERY DATA</h2>\n\n<ol>\n\t<li>Start analysis from choosing the source name of interest. Coordinates are resolved with the \"Resolve\" button, but you can in alternative enter coordinates. <a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/topoda1.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/topoda1.png?itok=Qwkoxiq4\" style=\"display:block; height:210px; width:480px\" /> </a></li>\n\t<li>Define time interval for the data. This could be done either in the \"Start time\" / \"End time\" fields in the multi-instrument top panel. It is also possible to provide the list of telescope pointings (Science Windows, SCW) in the dedicated parameter box in parameter box in INTEGRAL ISGRI panel. Note that SCW list input overrides the generic time interval input. Maximum number of SCWs is currently limited to 50. Format is \"219900320010.001,219900330010.001\". <a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/topoda2.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/topoda2.png?itok=QHzvSIab\" style=\"display:block; height:210px; width:480px\" /> </a></li>\n</ol>\n\n<h2>IMAGING ANALYSIS</h2>\n\n<ol>\n\t<li>Select \"Image\" checkbox and enter the energy interval for image extraction. Note that the analysis results are cached and entering \"standard\" energy bounds (e.g. 20-40 keV for OSA10.2 or 28-40 for OSA 11.0) might speed up the analysis because exsiting results would be evoked from cache memory rather than produced from scratch).</li>\n\t<li>Note that if the image is used just to have a catalog of sources for the next steps, it is possible to limit the number of science windows with the parameter \"maximum scws number\".</li>\n\t<li>The \"detection threshold\" is used to search for known and unknown sources in the image.</li>\n\t<li>Launch imaging analysis by pressing \"Submit\" button at the bottom of the INTEGRAL ISGRI parameter panel.</li>\n\t<li>For logged-in users an email is sent with the submittion, you can close the window and wait for a completion message.</li>\n\t<li>A pop-up window will let you know of the status and if it is completed. After closing it, a mosaic image is displayed in the centre of workspace. Inspect the image to check if your source of interest is detected.</li>\n\t<li>You can enter parameters for image and imaging results display: limits for the minimum and maximum significance which define the image color scale and minimal significance of detected source to be displayed in the imaging results catalog.</li>\n\t<li>Click on \"Catalog\" button. If your source of interest is detected in mosaic with significance higher than previously defined significance threshold, the source should appear in the catalog. You also have an option to download the catalog in FITS format for further analysis. \"Share\" will provide a link to the product. \"API code\" copoes on the clipboard the code for the python ODA API.</li>\n</ol>\n\n<p><a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/imaoda.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/imaoda.png?itok=JeSH32j5\" style=\"height:399px; width:480px\" /> </a></p>\n\n<h2>SPECTRAL ANALYSIS</h2>\n\n<p>You can prepare catalog for the spectral analysis from an image result or by uploading a fits/asci file.</p>\n\n<ol>\n\t<li>Catalog preparation\n\t<ol>\n\t\t<li>When you check a source, you can make an operation on it, like deleting or editing.</li>\n\t\t<li>You can delete multiple sources by using the ctrl or shift on your keyboard together with the mouse click (as in most file system explorers)</li>\n\t\t<li>After editing, <strong>uncheck the source </strong>. The catalog which appears will be used for the analysis when you click on \"use catalog\". (Note that if sources remain selected, only those ones will be used).</li>\n\t</ol>\n\t</li>\n\t<li>Uploading a catalog\n\t<ol>\n\t\t<li>Download the template end edit it with your preferred editor for text or fits</li>\n\t\t<li>Upload the catalog with \"Choose file\" <a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/odacatalog.png\"> <img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/odacatalog.png?itok=2lTthmuV\" style=\"display:block; height:222px; width:480px\" /> </a></li>\n\t</ol>\n\t</li>\n\t<li>If no source is checked or you forget to click on \"use catalog\", the full imaging catalog will be given as input for the spectral analysis. Spectra of all sources found in imaging will be generated (processing might take more time in this case). If there sources brighter than your source of interest in the mosaic image it is advised to include at least all the brighter sources in the spectral analysis. Otherwise the spectrum of the source of interest could not be reliable.</li>\n\t<li>Check the \"Spectum\" box in INTEGRAL ISGRI parameter field. Optionally choose the default spectral model for spectral analysis by entering the name of one of the valid XSPEC models in the additional parameter field which displays when \"Spectrum\" box is checked.</li>\n\t<li>Launch spectral analysis by clicking \"Submit\" button (you will receive an email). Once the analysis is done, a panel with the list of sources for which the spectra were produced displays in the centre of the INTEGRAL ISGRI workspace. You could click on \"Fit\" button next to your source of interest to see the results of the analysis. This includes a plot of the spectrum and the result of the spectral model fitting in XSPEC. You also have a possibility to download the spectrum in FITS format for further analysis.<a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/spectrumoda.png\"> <img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/spectrumoda.png?itok=ZDDmyAS4\" style=\"height:297px; width:480px\" /> </a></li>\n</ol>\n\n<h2>TIMING ANALYSIS</h2>\n\n<ol>\n\t<li>Check the \"Lightcurve\" checkbox. An additional set of parameters for lightcurve production shows up at the bottom of INTEGRAL ISGRI parameter panel. Enter the width of the time bin for the lightcurve in seconds. The Start and end time of the lightcurve are determined by the time limits set in the top multi-instrument panel or by the list of SCWs in the INTEGRAL ISGRI parameter panel. Maximal length of the time bin in the lightcurve is one SCW. If a time bin smaller but similar to the science duration is selected, the light curve will have also shorted bins, which will complete the science window duration (this is afeature of OSA for ISGRI).</li>\n\t<li>The use of catalog is the same as in the spectral extraction. Launch the lightcurve extraction by pressing \"Submit\" button</li>\n\t<li>Once the lightcurve is produced, you can click on the \"View\" button for your source of interest. The light curve can be downloaded from the display window. <a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/lcoda.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/lcoda.png?itok=c-AWoUaU\" style=\"display:block; height:477px; width:480px\" /> </a></li>\n\t<li>The light curve is displayed in the ISGRI workspace, together with the result of fitting on constant and linear function.  You have a possibility to download the lightcrve in FITS format for further analysis <a class=\"colorbox colorbox-insert-image\" href=\"/mmoda/sites/default/files/mmoda/help/mmoda-isgri/lightcurve.png\"><img alt=\"\" class=\"image-large\" src=\"/mmoda/sites/default/files/styles/large/public/mmoda/help/mmoda-isgri/lightcurve.png?itok=4JzA9_2D\" style=\"display:block; height:480px; width:391px\" /> </a></li>\n</ol>\n\n<h2>CAVEATS / KNOWN ISSUES</h2>\n\n<ol>\n\t<li>If the source is not detected on single SCW level no empty lightcurve file is produced.</li>\n\t<li>Maximal width of the lightcurve time bin is now one SCW. Enetring longer time bin width would result in generation of SCW-by-SCW lightcurve.</li>\n\t<li>Entering width of the time bin shorter than 10 seconds for the timing extraction would lead to exceedingly long processing time and finally to the timeout of the session because of the specific of